// Department.js
import React from 'react';

function Department() {
  return (
    <div>
      <h1>Departments</h1>
      <ul>
        <li>Cardiology</li>
        <li>Neurology</li>
        <li>Oncology</li>
        <li>Orthopedics</li>
        <li>Pediatrics</li>
        <li>Psychiatry</li>
        <li>Radiology</li>
      </ul>
    </div>
  );
}

export default Department;
